import React from 'react'

const Hello = (props) => {
    return (
        <div>
            <p>Hello world {props.age}</p>
        </div>
    )
}
const App = () => {
    return (
        <div>
            <h1>Greetings</h1>
            <Hello/>
            <Hello age={10+10}/>
            <Hello/>
        </div>
    )
}

export default App
